import React from 'react';
import * as S from './style';

export interface TypographyProps {
  children: React.ReactNode;
  className?: string;
  italic?: boolean;
  strong?: boolean;
  type?: 'default' | 'secondary' | 'success' | 'error' | 'warning' | 'common' | 'subtitle';
  fontFamily?: string;
  fontSize?: number;
  style?: React.CSSProperties;
  dataTst?: string;
}

const Typography: React.FC<TypographyProps> = ({
  children, fontFamily, type, fontSize, style, italic, strong, dataTst, className,
}: TypographyProps) => (
  <S.Typography
    italic={italic}
    strong={strong}
    style={style}
    fontFamily={fontFamily}
    fontSize={fontSize || 12}
    type={type || 'default'}
    className={className}
    data-tst={dataTst}
  >
    {children}
  </S.Typography>
);

export default Typography;
